-- TOC entry 2295 (class 1255 OID 947977)
-- Name: create_field_page_req(integer, integer, text, jsonb); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.create_field_page_req(project_id integer, source_id integer, parent_scope_type text, nestedreqs jsonb) RETURNS TABLE(pk_project integer, scope_type text, is_outgoing boolean, fk_property integer, source_info_id integer, source_data_id integer, source_tables_cell_id bigint, source_tables_row_id bigint, is_circular boolean, _limit integer, _offset integer, targets jsonb)
    LANGUAGE plpgsql
    AS $$
DECLARE
    scope_type text;
    subReq jsonb;
    page jsonb;
    targets jsonb;
    req jsonb;
BEGIN
    -- Generate the scope type of the subpages
    IF parent_scope_type = 'notInProject' THEN
        scope_type := 'inRepo';
    ELSE
        scope_type := parent_scope_type;
    END IF;

	RETURN QUERY
	SELECT 
		project_id AS pk_project,
		scope_type,
		(page_request->'page'->'isOutgoing')::bool is_outgoing,
		(page_request->'page'->'property'->'fkProperty')::int AS fk_property,
		source_id AS source_info_id,
		NULL::int AS source_data_id,
		NULL::bigint AS source_tables_cell_id,
		NULL::bigint AS source_tables_row_id,
        (page_request->'page'->'isCircular')::bool AS is_circular,		
		(page_request->'page'->'limit')::int AS _limit,		
		(page_request->'page'->'offset')::int AS _offset,
		page_request->'targets' targets
	FROM jsonb_array_elements(nestedReqs) page_request;  
END;
$$;


