-- Name: evpr_fk_entity_fk_entity_version(); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.evpr_fk_entity_fk_entity_version() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
        DECLARE
        result text;
  
    BEGIN
    
    -- Added if condition:
    -- only if there is a fk_entity_version_concat, generate fk_entity and fk_entity_version

    IF (NEW.fk_entity_version_concat IS NOT NULL) THEN
      NEW.fk_entity = split_part(NEW.fk_entity_version_concat, '_', 1)::integer;
      NEW.fk_entity_version = split_part(NEW.fk_entity_version_concat, '_', 2)::integer;
    END IF;
      
    RETURN NEW;
    END;
    
  $$;


--
-- TOC entry 2298 (class 1255 OID 947980)
-- Name: field_page_incoming_in_project(integer, integer, integer, integer, bigint, bigint, integer, integer); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.field_page_incoming_in_project(_project_id integer, _fk_property integer, _source_info_id integer, _source_data_id integer, _source_tables_cell_id bigint, _source_tables_row_id bigint, _limit integer, _offset integer) RETURNS TABLE(valid_for timestamp with time zone, paginated_statement json, target_class integer, target_entity_id integer, ord_num bigint, count integer)
    LANGUAGE plpgsql
    AS $$
    DECLARE 
      res jsonb;
    BEGIN
      RETURN QUERY
      --------------------------------------------------------------------------
      -- FINAL SELECT
      --------------------------------------------------------------------------
      SELECT
        	now() valid_for,
          stmt.obj paginated_statement,
          stmt.target_class,
          stmt.target_entity_id,
          ROW_NUMBER() OVER (ORDER BY ord_num_of_domain ASC NULLS LAST, pk_entity DESC) ord_num,
          COALESCE(full_count, 0)::int count
      FROM (
        --------------------------------------------------------------------------
        -- PAGINATED SELECT
        --------------------------------------------------------------------------
        SELECT
          json_strip_nulls (json_build_object('projRel', gv_to_jsonb (t2), 'isOutgoing', false, 'ordNum', t2.ord_num_of_domain, 'target', t3.target_obj, 'targetClass', t3.target_class, 'targetLabel', t3.target_label, 'statement', gv_to_jsonb (t1))) obj,
          count(*) OVER () AS full_count,
          t2.ord_num_of_domain,
          t1.pk_entity,
          t3.target_class,
          (t3.target_obj->'entity'->'resource'->'pk_entity')::int target_entity_id
        FROM
          information.v_statement t1,
          projects.v_info_proj_rel t2,
          commons.get_statement_target(_project_id, t1.fk_subject_info, t1.fk_subject_data, t1.fk_subject_tables_cell, t1.fk_subject_tables_row) t3
        WHERE
          --------------------------------------------------------------------------
          -- JOIN SOURCE ENTITY WITH STATEMENTS
          --------------------------------------------------------------------------
          t1.fk_object_info = _source_info_id
          AND t1.fk_object_data = _source_data_id
          AND t1.fk_object_tables_cell = _source_tables_cell_id
          AND t1.fk_object_tables_row = _source_tables_row_id
          AND t1.fk_property = _fk_property
          --------------------------------------------------------------------------
          -- JOIN STATEMENTS WITH PROJECT RELS
          --------------------------------------------------------------------------
          AND t1.pk_entity = t2.fk_entity
          AND t2.is_in_project = TRUE
          AND t2.fk_project = _project_id
          --------------------------------------------------------------------------
          -- order the statements according to order number of target
          --------------------------------------------------------------------------
        ORDER BY
          t2.ord_num_of_domain ASC NULLS LAST, t1.pk_entity DESC
          --------------------------------------------------------------------------
          -- paginate according to the requested limit / offset
          --------------------------------------------------------------------------
        LIMIT CASE WHEN _limit=0 THEN 1 ELSE _limit END
        OFFSET _offset) AS stmt;
    END
    $$;


--
-- TOC entry 2299 (class 1255 OID 947981)
-- Name: field_page_incoming_in_repo(integer, integer, integer, bigint, bigint, integer, integer); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.field_page_incoming_in_repo(_fk_property integer, _source_info_id integer, _source_data_id integer, _source_tables_cell_id bigint, _source_tables_row_id bigint, _limit integer, _offset integer) RETURNS TABLE(valid_for timestamp with time zone, paginated_statement json, target_class integer, target_entity_id integer, ord_num bigint, count integer)
    LANGUAGE plpgsql
    AS $$
    DECLARE 
      res jsonb;
    BEGIN
      RETURN QUERY
      --------------------------------------------------------------------------
      -- FINAL SELECT
      --------------------------------------------------------------------------
      SELECT
        now() valid_for,
        stmt.obj paginated_statements,
        stmt.target_class,
        stmt.target_entity_id,
        ROW_NUMBER() OVER () ord_num,
        COALESCE(full_count, 0)::int count
      FROM (
        --------------------------------------------------------------------------
        -- PAGINATED SELECT
        --------------------------------------------------------------------------
        SELECT
          json_strip_nulls (json_build_object('isOutgoing', false, 'target', t3.target_obj, 'targetClass', t3.target_class, 'targetLabel', t3.target_label, 'statement', gv_to_jsonb (t1))) obj,
          count(*) OVER () AS full_count,
          t3.target_class,
          (t3.target_obj->'entity'->'resource'->'pk_entity')::int target_entity_id
        FROM
          information.v_statement t1,
          commons.get_statement_target(0, t1.fk_subject_info, t1.fk_subject_data, t1.fk_subject_tables_cell, t1.fk_subject_tables_row) t3
        WHERE
          --------------------------------------------------------------------------
          -- JOIN SOURCE ENTITY WITH STATEMENTS
          --------------------------------------------------------------------------
          t1.fk_object_info = _source_info_id
          AND t1.fk_object_data = _source_data_id
          AND t1.fk_object_tables_cell = _source_tables_cell_id
          AND t1.fk_object_tables_row = _source_tables_row_id
          AND t1.fk_property = _fk_property
          AND t1.is_in_project_count > 0

        --------------------------------------------------------------------------
        -- THE FOLLOWING ORDER BY CLAUSE IS DISABLED FOR PERFORMANCE REASONS
        -- ORDER BY
        --   t1.pk_entity DESC

        --------------------------------------------------------------------------
        -- paginate according to the requested limit / offset
        --------------------------------------------------------------------------
        LIMIT CASE WHEN _limit=0 THEN 1 ELSE _limit END
        OFFSET _offset) AS stmt;
    END
    $$;


--
-- TOC entry 2300 (class 1255 OID 947982)
-- Name: field_page_incoming_no_constraint(integer, integer, integer, bigint, bigint, integer, integer); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.field_page_incoming_no_constraint(_fk_property integer, _source_info_id integer, _source_data_id integer, _source_tables_cell_id bigint, _source_tables_row_id bigint, _limit integer, _offset integer) RETURNS TABLE(valid_for timestamp with time zone, paginated_statement json, target_class integer, target_entity_id integer, ord_num bigint, count integer)
    LANGUAGE plpgsql
    AS $$
    DECLARE 
      res jsonb;
