-- TOC entry 2308 (class 1255 OID 947991)
-- Name: get_entity_preview_table_name(); Type: FUNCTION; Schema: commons; Owner: -
--

CREATE FUNCTION commons.get_entity_preview_table_name() RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    table_name text;
BEGIN
    SELECT
        substring(view_definition FROM 'FROM[[:space:]]+([[:alnum:]_\.]+)')
    FROM
        information_schema.views t1
    WHERE
        t1.table_schema = 'war'
        AND t1.table_name = 'entity_preview' INTO table_name;
    RETURN table_name;
END;
$$;


