CREATE FUNCTION commons.get_field_page(page_request jsonb) RETURNS jsonb
    LANGUAGE plpgsql
    AS $$
DECLARE
  -- request vars
  _pkProject int;
	_scope_type text;
  _isOutgoing bool;
  _propertyFkProperty int;
